import {takeLatest, put} from "redux-saga/effects";
import axios from 'axios';

function* singInAsync(data) {
  console.log('hihi');
}

export function* watchSingIn(data) {
  yield takeLatest({type :"CALL-API-SINGIN", data}, singInAsync(data));
}
